#!/bin/bash

set -e
pkcs12_file=""
sm3_base64=""
output_path="accounts_gm"
sm3_bin="/tmp/sm3"
sm3_tar="/tmp/sm3.tgz"
TASSL_CMD="${HOME}/.fisco/tassl"

help() {
    echo $1
    cat << EOF
Usage: $0
    default       generate account and store private key in PEM format file
    -p            generate account and store private key in PKCS12 format file
    -k [FILE]     calculate address of PEM format [FILE]
    -P [FILE]     calculate address of PKCS12 format [FILE]
    -h Help
EOF

exit 0
}

prepare_sm3()
{
    if [[ ! -f ${sm3_bin} ]];then
        if [ "$(uname)" == "Darwin" ];then
            sm3_base64=""
            echo ${sm3_base64} | base64 -D - > ${sm3_tar}
        else
            if [[ "$(uname -p)" == "aarch64" ]];then
                sm3_base64=""
            else
                sm3_base64=""
            fi
                echo ${sm3_base64} | base64 -d - > ${sm3_tar}
        fi
        tar -zxf ${sm3_tar} -C /tmp && rm ${sm3_tar}
        if [[ -f ${sm3_bin} ]];then
            chmod a+rx ${sm3_bin}
        fi
        if [[ "$(uname -p)" == "aarch64" ]];then
            sm3_bin="/tmp/calculate_address -g"
            chmod a+rx "/tmp/calculate_address"
        fi
    fi
    mkdir -p ${output_path}
}

# TASSL env
check_and_install_tassl()
{
    if [ ! -f "${TASSL_CMD}" ];then
        LOG_INFO "Downloading tassl binary ..."
        if [ "$(uname)" == "Darwin" ];then
            tassl_macOS=""
            echo ${tassl_macOS} | base64 -D - > tassl.tar.gz
        else
            local tassl_link_perfix="https://osp-1257653870.cos.ap-guangzhou.myqcloud.com/FISCO-BCOS/FISCO-BCOS/tools/tassl-1.0.2"
            if [[ "$(uname -p)" == "aarch64" ]];then
                curl -#LO "${tassl_link_perfix}/tassl-aarch64.tar.gz"
                mv tassl-aarch64.tar.gz tassl.tar.gz
            elif [[ "$(uname -p)" == "x86_64" ]];then
                curl -#LO "${tassl_link_perfix}/tassl.tar.gz"
            else
                LOG_ERROR "Unsupported platform"
                exit 1
            fi
        fi
        tar zxvf tassl.tar.gz
        chmod a+x tassl
        mkdir -p "${HOME}/.fisco"
        mv tassl "${TASSL_CMD}"
    fi
}

LOG_INFO()
{
    local content=${1}
    echo -e "\033[32m[INFO] ${content}\033[0m"
}

check_env() {
    check_and_install_tassl
}

calculate_address_pem()
{
    local pem_file=$1
    local no_print="$2"
    local suffix=${pem_file##*.}
    if [[ "${suffix}" != "pem" ]];then
        echo "The suffix of ${pem_file} is not pem. Please check it."
        exit 1
    fi
    prepare_sm3
    privKey=$(${TASSL_CMD} ec -in ${pem_file} -text -noout 2>/dev/null| sed -n '3,5p' | tr -d ": \n" | awk '{print $0}')
    pubKey=$(${TASSL_CMD} ec -in ${pem_file} -text -noout 2>/dev/null| sed -n '7,11p' | tr -d ": \n" | awk '{print substr($0,3);}')
    # echo "public key = ${pubKey}"
    accountAddress=$(${sm3_bin}  ${pubKey})
    [ ! -z "${no_print}" ] || LOG_INFO "Account Address   : 0x${accountAddress}"
}

calculate_address_pkcs12()
{
    local p12_file=$1
    local pem_file="/tmp/.tmp.pem"
    local suffix=${p12_file##*.}
    if [[ "${suffix}" != "p12" && "${suffix}" != "pfx" ]];then
        echo "The suffix of ${p12_file} is neither p12 nor pfx. Please check it."
        exit 1
    fi
    ${TASSL_CMD} pkcs12 -in ${p12_file} -out ${pem_file} -nodes 2>/dev/null
    calculate_address_pem ${pem_file}
    rm ${pem_file}
}

generate_gmsm2_param()
{
    local output=$1
    cat << EOF > "${output}"
-----BEGIN EC PARAMETERS-----
BggqgRzPVQGCLQ==
-----END EC PARAMETERS-----
EOF
}

main()
{
    while getopts "k:pP:h" option;do
        case $option in
        k) calculate_address_pem "$OPTARG"
        exit 0;;
        P) calculate_address_pkcs12 "$OPTARG"
        exit 0;;
        p) #pkcs12_file="$OPTARG"
        pkcs12_file="true"
        ;;
        h) help;;
        esac
    done
    check_env
    prepare_sm3
    if [ ! -f /tmp/gmsm2.param ];then
        generate_gmsm2_param /tmp/gmsm2.param
    fi
    ${TASSL_CMD} genpkey -paramfile /tmp/gmsm2.param -out ${output_path}/ecprivkey.pem 2>/dev/null
    calculate_address_pem ${output_path}/ecprivkey.pem "true"
    output_file_prefix=${output_path}/0x${accountAddress}
    if [ -z "$pkcs12_file" ];then
        mv ${output_path}/ecprivkey.pem ${output_file_prefix}.pem
        LOG_INFO "Account Address   : 0x${accountAddress}"
        LOG_INFO "Private Key (pem) : ${output_file_prefix}.pem"
        # echo "0x${privKey}" > ${output_file_prefix}.private.hex
        ${TASSL_CMD} ec -in ${output_file_prefix}.pem -pubout -out ${output_file_prefix}.public.pem 2>/dev/null
        LOG_INFO "Public  Key (pem) : ${output_file_prefix}.public.pem"
    else
        LOG_INFO "Note: the entered password cannot contain Chinese characters!"
        ${TASSL_CMD} pkcs12 -export -name key -nocerts -inkey "${output_path}/ecprivkey.pem" -out "${output_file_prefix}.p12" 2>/dev/null || $(rm ${output_file_prefix}.p12 && rm ${output_path}/ecprivkey.pem && exit 1)
        ${TASSL_CMD} ec -in ${output_path}/ecprivkey.pem -pubout -out ${output_file_prefix}.public.pem 2>/dev/null
		rm ${output_path}/ecprivkey.pem
        LOG_INFO "Account Address   : 0x${accountAddress}"
        LOG_INFO "Private Key (p12) : ${output_file_prefix}.p12"
		LOG_INFO "Public  Key (pem) : ${output_file_prefix}.public.pem"
    fi
    # LOG_INFO "Private Key (hex) : 0x${privKey}"
    # echo "0x${pubKey}" > ${output_path}/${accountAddress}.public.hex
    # LOG_INFO "Public  File(hex) : ${output_path}/${accountAddress}.public.hex"
}

main $@

